import React from "react";
import {
  Grid,
  makeStyles,
  TextField,
  Card,
  FormControl,
  InputLabel,
  Select,
} from "@material-ui/core";
import dayjs from "dayjs";

const useStyles = makeStyles(() => ({
  root: {},
  content: {
    padding: "15px",
  },
}));

const CultureInfo = (props) => {
  const classes = useStyles();
  const { states, handleOnChange } = props;

  return (
    <Card className={classes.content}>
      <Grid container spacing={2}>
        <Grid item xs={12}>
          <TextField
            label="Name"
            size="small"
            fullWidth
            value={states.name}
            onChange={handleOnChange("name")}
          />
        </Grid>
        <Grid item xs={12}>
          <TextField
            label="Last Date"
            size="small"
            fullWidth
            type="date"
            value={dayjs(states.lastDate).format("YYYY-MM-DD")}
            onChange={handleOnChange("lastDate")}
          />
        </Grid>
        <Grid item xs={12}>
          <TextField
            label="Clinic"
            size="small"
            fullWidth
            value={states.clinic}
            onChange={handleOnChange("clinic")}
          />
        </Grid>
        <Grid item xs={12}>
          <TextField
            label="Address"
            size="small"
            fullWidth
            value={states.address}
            onChange={handleOnChange("address")}
          />
        </Grid>
        <Grid item xs={12}>
          <TextField
            label="Phone"
            size="small"
            value={states.phone}
            type="tel"
            onChange={handleOnChange("phone")}
          />
        </Grid>
      </Grid>
    </Card>
  );
};

export default CultureInfo;
